import React from "react";
import { View } from "react-native";
import Repositories from "./Repositories";
import AppBar from "./AppBar";

const OtroMain = () => {

  return (
    <View style >
      <AppBar />
      <Repositories />
    </View>
  );
};

export default OtroMain;
